FunctionBody.FormulaText:
var characters = pFormula.ToCharArray();

for(var c in characters)
{
                value = c.ToString();
               
                if(value != '+' && value != '-' && value != ' ')
                {
                                return false;
                }
}

return true;

var formula = Context.Entity.Fields["SummaryFormula"].Value.ToString();

var bucket = pPosition -1;

if (formula.Substring(bucket,1) == '+')
return 1;
if (formula.Substring(bucket,1) == '-')
return -1;
return 0;
